import React, { Fragment } from "react";
import { Card, Row, Col, Divider } from "antd";

const ReservationList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(reserv => (
          <Col key={reserv.id}>
            <Card
              key={reserv.id}
              style={{ width: "300px" }}
              className="border border-info rounded"
              title={
                <h4 className="text-center text-dark border border-primary rounded">{`Table: ${reserv.table_number}`}</h4>
              }
              cover={
                <h4 className="text-info  text-center mt-4">
                  {reserv.customer_name}
                </h4>
              }
            >
              <Divider />
              <Card.Meta
                title={
                  <h4 className="text-success">{`Seats:${reserv.seats}`}</h4>
                }
                description={
                  <p className="text-danger">{`Date: ${reserv.date}`}</p>
                }
              />
            </Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ReservationList;
